import React, { useState } from "react";
import Avatar from "@mui/material/Avatar";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import Divider from "@mui/material/Divider";
import Navigation from "../navigation/Navigation"; // Import your Navigation component
import Suggestions from "../suggestions/Suggestions"; // Import your Suggestions component
import "./Profile.css";

const dummyUser = {
  username: "Josue_Soub",
  fullName: "Josue Soubeyran",
  bio: "Fier d'être né",
  followers: 9,
  following: 9,
  posts: [
    {
      id: 1,
      imageUrl:
        "data:image/png;base64,",
    },
    {
      id: 2,
      imageUrl:
        "data:image/jpeg;base64,",
    },
  ],
};

const Profile__ = () => {
  const [user, setUser] = useState(dummyUser);
  const [isSubscribed, setIsSubscribed] = useState(false);

  const toggleSubscription = () => {
    setIsSubscribed(!isSubscribed);
  };

  return (
    <div className="profile-container">
      <Grid container spacing={3}>
        <Grid item xs={12} md={3}>
          <Navigation />
        </Grid>
        <Grid item xs={12} md={6}>
          <Grid container spacing={3}>
            <Grid item xs={12} md={4}>
              <Avatar
                alt={user.username}
                src="data:image/jpeg;base64,"
                sx={{ width: 150, height: 150 }}
              />
            </Grid>
            <Grid item xs={12} md={8}>
              <Typography variant="h4">Josue_Soub</Typography>
              <Typography variant="subtitle1">{user.fullName}</Typography>
              <Typography variant="body1" sx={{ marginTop: 2 }}>
                {user.bio}
              </Typography>
              <Button
                variant="outlined"
                sx={{ marginTop: 2 }}
                onClick={toggleSubscription}
                style={{
                  color: isSubscribed ? "white" : "white",
                  background_color: isSubscribed ? "white" : "white",
                }}
              >
                {isSubscribed ? "Abonné" : "S'abonner"}
              </Button>
            </Grid>

            <Grid item xs={12}>
              <Divider />
            </Grid>

            <Grid item xs={4}>
              <Typography variant="h6">{user.posts.length}</Typography>
              <Typography variant="subtitle2">Publications</Typography>
            </Grid>
            <Grid item xs={4}>
              <Typography variant="h6">{user.followers}</Typography>
              <Typography variant="subtitle2">Abonnés</Typography>
            </Grid>
            <Grid item xs={4}>
              <Typography variant="h6">{user.following}</Typography>
              <Typography variant="subtitle2">Abonnement</Typography>
            </Grid>

            <Grid item xs={12}>
              <Divider />
            </Grid>

            <Grid item xs={12}>
              <Grid container spacing={2}>
                {user.posts.map((post) => (
                  <Grid item xs={4} key={post.id}>
                    <img
                      src={post.imageUrl}
                      alt={`Post ${post.id}`}
                      style={{
                        width: "100%",
                        height: "100%",
                        objectFit: "cover",
                      }}
                    />
                  </Grid>
                ))}
              </Grid>
            </Grid>
          </Grid>
        </Grid>
        <Grid item xs={12} md={3}>
          <Suggestions />
        </Grid>
      </Grid>
    </div>
  );
};

export default Profile__;
